import "./index.scss";
import LoginPage from "../components/LoginPage"
import WindowLayout from "../components/WindowLayout"

const Index = ({ session }) => {

  const login = (username, password) => {
    alert(`setting session ${username} ${password}`)
    session.user = username
  }

  return <WindowLayout session={session} height="380px" width="380px" logo>
    {console.log("INDEX SESSION")}
    {console.log(session)}
    {console.log(session.user)}
    <LoginPage session={session} user={session.user} login={login}/>
  </WindowLayout>}

export default Index
